// src/components/HomePage.js
import React from 'react';
import './HomePage.css';
import SignupButton from './SignupButton'; // Adjust the relative path
import LoginButton from './LoginButton';   // Adjust the relative path

const HomePage = () => {
  return (
    <div>
      <h1>Welcome to ttgen!</h1>
      <SignupButton />
      <LoginButton />
      {/* Add any other content for your home page */}
    </div>
  );
};

export default HomePage;
